    'placeholder':              "&bsol;> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec fermentum nunc id felis sollicitudin porttitor.<br>&bsol;> ", // placeholder text
    'button_about':             '&bsol;> {protocell:labs} was founded in 2021 as a digital laboratory that merges artistic and research practices. Within the lab, we explore computational structures, mathematical organizational forms, design algorithms, artificial biology, emergent morphogenesis, and digital graphics. Our preferred mode of expression is chain-agnostic, long-form generative collections, which we began releasing on the fxhash.xyz platform in 2021. These collections feature a strong emphasis on complex 3D geometry, choreographed animation, and interactivity.<br><br>As a matter of principle, we keep our code open—unminified, unobfuscated, and available in public repositories like GitHub. It is thoroughly documented through code comments, GitHub commits, articles, and recorded talks to serve as a source of inspiration for others. Additionally, the code for our generative collections is stored on-chain on blockchains such as Ethereum and Tezos, or on decentralized protocols like IPFS. We believe that the development of open generative tools, the fusion of artistic expression with scholarship, and the promotion of responsible Web3 practices are missions that every generative artist should embrace.<br><br>Founders<br><br>Luka Piskorec and Kane Borg met in Helsinki as researchers in the Aalto Design of Structures group. Both are practicing architects with extensive backgrounds in algorithmic design and digital fabrication, and have been teaching and researching at the university level since 2011 (at ETH Zürich and Aalto University).<br><br>Affiliations<br><br>Luka Piskorec co-founded <a href="https://www.ten.studio/" target="_blank">TEN Studio ↗</a>, architecture, design and research association based in Zürich and Belgrade.<br><br>Kane Borg co-founded <a href="https://borgmarkkula.com/" target="_blank">Borg Markkula Oy ↗</a>, a computational design consultancy based in Finland.<br><br>Website credits<br><br>This website is built using open-source frameworks <a href="https://p5js.org/" target="_blank">p5.js ↗</a>, <a href="https://threejs.org/" target="_blank">three.js ↗</a>, <a href="https://brm.io/matter-js/" target="_blank">matter.js ↗</a> and CC0 font MonoMEK by <a href="https://mek.gallery/" target="_blank">MEK.txt ↗</a>.<br>&bsol;> ',

